import React from 'react';

function About() {
    return(
        <section id="about">
      <section id="your-trainers" class="trainers">
        <article class="trainer">
          <img src="./assets/images/ThanksAyana.jpg" alt="picture of me" />
          <div class="trainer-bio text-left">
            <h3><span>Hello my name is John</span></h3>
            <h4>Junior Web Developer / Nerd</h4>
            <p>
              I am beginning my journey in my professional career as a junior web developer.
              I started programming when I was young messing with the terminal tryong to piece together a C program to now making fuctional websites and software.
              I'm looking for work with a company where I can grow and learn while providing valuable work.
            </p>
          </div>
        </article>
      </section>
    </section>
    );

}

export default About;
